        this.plus = this.plus.bind(this);
    }

     plus = (e) => {
        this.setState({
            num: this.state.num +1
        })
     }
     minus = (e) => {
        this.setState({
            num: this.state.num -1
        })
     }

    render() {
        return (
            <div>
                <h1>Counter</h1>
                <div>{this.state.num}</div>
                <button onClick={this.plus}>+</button>
                <button onClick={this.minus}>-</button>
            </div>
        )
    }
}

